import React from 'react';
import './SelectCharacter.css';
function SelectCharacter() {

  const characters = [
    { id: 1, name: "Rick", image: "Rick.jpg" },
    { id: 2, name: "Rick", image: "Rick.jpg" },
    { id: 3, name: "Rick", image: "Rick.jpg" },
    { id: 4, name: "Rick", image: "Rick.jpg" },
    { id: 5, name: "Rick", image: "Rick.jpg" },
    { id: 6, name: "Rick", image: "Rick.jpg" },
    { id: 7, name: "Rick", image: "Rick.jpg" },
    { id: 8, name: "Rick", image: "Rick.jpg" },
  ];

  return (
    <div className="container">
      <div className="header">
        <h1><a href="/">NEX</a></h1>
      </div>
      <div className="select_container">
        <h1 className="select_header">SELECT CHARACTER</h1>
        <div className="character_container">
          {characters.map(character => (
            <div key={character.id} className="character_card">
              <img src={character.image} alt={character.name}/>
              <p>{character.name}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default SelectCharacter;
